import { useState, useEffect } from 'react';

export default function Author() {

  const [authors, setAuthors] = useState([]);

  useEffect(() => {
    fetch('/authors')
      .then(res => res.json())
      .then(data => setAuthors(data))
  }, []);

  return (
    <table>
      <thead>
        <tr>
          <th>ID</th>
          <th>Name</th>    
        </tr>
      </thead>

      <tbody>
        {authors.map(author => (
          <tr key={author.id}>
            <td>{author.id}</td>
            <td>{author.name}</td>
          </tr>
        ))}
      </tbody>

    </table>
  );

}
